import { useState } from "react";
import Title from "./Title";
import "./App.css";






const GameBoard = () => {
  return (
    <div className="GameBoard">
      <BotHand />
      <CenterInfo />
      <PlayerHand />
    </div>
  );
};

const App = () => {
  return (
    <>
      <Title />
      <GameBoard />
    </>
  );
};

export default App;
